import React from 'react'

const CartItem = ({ data, delFromCard }) => {
  const { id, name, price } = data

  return (
    <li className='my-1 w-5'>
      <span className='text-bolder'>
        {name} <span className='text-muted'> {price} </span>
      </span>
      <button className='btn btn-sm btn-outline-danger mx-1'>Eliminar</button>
    </li>
  )
}

export default CartItem
